import React from 'react';

import Authorize from 'react-authorize';
import 'react-authorize/dist/index.css';

const App = () => {
  return (
    <div>
      <div style={{textAlign: 'center'}}>
        <Authorize check={['LIST_DASHBOARD', 'EDIT_DASHBOARD']} permissions={['LIST_DASHBOARD', 'EDIT_DASHBOARD', 'DELETE_DASHBOARD']}>
          <button>Go to Dashboard</button>
        </Authorize>
      </div>
    </div>
  );
};

export default App;
